import React from "react";
import { Container, Button, Images } from "./RegisterElements";
import { Link } from "react-router-dom";

import logo from "../../assets/images/logo/stessis_white.png";

function Register() {
  return (
    <Container>
      <div className="row">
        <div className="login">
          <Images>
            <img src={logo} alt="Stessis Logo" width="200px" />
          </Images>
          <p>Join us today! it takes only a few steps</p>
          <input type="text" name="name" placeholder="Enter Username" />
          <input type="email" name="email" placeholder="Enter Email" />
          <input type="password" name="name" placeholder="Enter Password" />
          <Link to="/landing">
            <Button>REGISTER</Button>
          </Link>
        </div>
        <div className="photo">
          Already have an account? <Link to="/login">Sign In</Link>
        </div>
      </div>
    </Container>
  );
}

export default Register;
